function Footer () {
    return (
        <footer className="bg-light py-5">
            <div className="container px-4 px-lg-5">
                <div className="small text-center text-muted">Copyright &copy; 2023 - AidALL</div>
            </div>
            <div className="text-center">
                <a className="btn btn-light btn" href="http://127.0.0.1:5500/policy.html#about"><div className="small text-center text-muted">인재채용</div></a>
                <a className="btn btn-light btn" href="http://127.0.0.1:5500/index.html#about"><div className="small text-center text-muted">제휴제안</div></a>
                <a className="btn btn-light btn" href="http://127.0.0.1:5500/index.html#about"><div className="small text-center text-muted">이용약관</div></a>
                <a className="btn btn-light btn" href="http://127.0.0.1:5500/index.html#about"><div className="small text-center text-muted">개인정보처리방침</div></a>
                <a className="btn btn-light btn" href="http://127.0.0.1:5500/index.html#about"><div className="small text-center text-muted">고객센터</div></a>
            </div>
        </footer>        
    );
}

export default Footer;
